"ko": |-
  에이전트는 요청 메시지에 사용된 RTSP 버전을 지원하지 않거나 지원을 거부합니다. 에이전트는 이 오류 메시지 외에는 에이전트와 동일한 주요 버전을 사용하여 요청을 완료할 수 없거나 완료할 의사가 없음을 나타냅니다. 응답에는 해당 버전이 지원되지 않는 이유와 해당 에이전트가 지원하는 다른 프로토콜을 설명하는 메시지 본문이 포함되어야 합니다.
